/*Returns the molar production rate of species */
/*Given rho, T, and mole fractions */
void CKWXR(double *  rho, double *  T, double *  x,  double *  wdot)
{
    int id; /*loop counter */
    double c[47]; /*temporary storage */
    double XW = 0; /*See Eq 4, 11 in CK Manual */
    double ROW; 
    /*Compute mean molecular wt first */
    XW += x[0]*28.013400; /*N2 */
    XW += x[1]*14.027090; /*S-CH2 */
    XW += x[2]*14.027090; /*T-CH2 */
    XW += x[3]*15.999400; /*O */
    XW += x[4]*2.015940; /*H2 */
    XW += x[5]*1.007970; /*H */
    XW += x[6]*17.007370; /*OH */
    XW += x[7]*18.015340; /*H2O */
    XW += x[8]*31.998800; /*O2 */
    XW += x[9]*33.006770; /*HO2 */
    XW += x[10]*13.019120; /*CH */
    XW += x[11]*28.010550; /*CO */
    XW += x[12]*29.018520; /*HCO */
    XW += x[13]*30.026490; /*CH2O */
    XW += x[14]*15.035060; /*CH3 */
    XW += x[15]*44.009950; /*CO2 */
    XW += x[16]*16.043030; /*CH4 */
    XW += x[17]*27.046210; /*C2H3 */
    XW += x[18]*28.054180; /*C2H4 */
    XW += x[19]*29.062150; /*C2H5 */
    XW += x[20]*25.030270; /*C2H */
    XW += x[21]*41.029670; /*HCCO */
    XW += x[22]*26.038240; /*C2H2 */
    XW += x[23]*39.057360; /*C3H3 */
    XW += x[24]*41.073300; /*A-C3H5 */
    XW += x[25]*43.089240; /*N-C3H7 */
    XW += x[26]*30.070120; /*C2H6 */
    XW += x[27]*40.065330; /*P-C3H4 */
    XW += x[28]*40.065330; /*A-C3H4 */
    XW += x[29]*78.114720; /*A1 */
    XW += x[30]*77.106750; /*A1- */
    XW += x[31]*65.095600; /*C5H5 */
    XW += x[32]*42.081270; /*C3H6 */
    XW += x[33]*56.108360; /*C4H8 */
    XW += x[34]*66.103570; /*C5H6 */
    XW += x[35]*128.175260; /*A2 */
    XW += x[36]*70.135450; /*C5H10 */
    XW += x[37]*71.143420; /*C5H11 */
    XW += x[38]*103.144990; /*A1C2H2 */
    XW += x[39]*91.133840; /*A1CH2 */
    XW += x[40]*106.125270; /*A1CHO */
    XW += x[41]*92.141810; /*A1CH3 */
    XW += x[42]*99.197600; /*C7H15 */
    XW += x[43]*100.205570; /*N-C7H16 */
    XW += x[44]*101.129050; /*A1C2H* */
    XW += x[45]*127.167290; /*A2- */
    XW += x[46]*102.137020; /*A1C2H */
    /*Extra 1e6 factor to take c to SI */
    ROW = 1e6*(*rho) / XW;

    /*Compute conversion, see Eq 11 */
    for (id = 0; id < 47; ++id) {
        c[id] = x[id]*ROW;
    }

    /*convert to chemkin units */
    productionRate(wdot, c, *T);

    /*convert to chemkin units */
    for (id = 0; id < 47; ++id) {
        wdot[id] *= 1.0e-6;
    }
}


/*Returns the rate of progress for each reaction */
void CKQC(double *  T, double *  C, double *  qdot)
{
    int id; /*loop counter */

    /*convert to SI */
    for (id = 0; id < 47; ++id) {
        C[id] *= 1.0e6;
    }

    /*convert to chemkin units */
    progressRate(qdot, C, *T);

    /*convert to chemkin units */
    for (id = 0; id < 47; ++id) {
        C[id] *= 1.0e-6;
    }

    for (id = 0; id < 224; ++id) {
        qdot[id] *= 1.0e-6;
    }
}


