    kc[212] = refC * exp((g_RT[40] + g_RT[5]) - (g_RT[30] + g_RT[11] + g_RT[4]));

    /*reaction 214: A1CHO + CH3 => A1- + CO + CH4 */
    kc[213] = refC * exp((g_RT[40] + g_RT[14]) - (g_RT[30] + g_RT[11] + g_RT[16]));

    /*reaction 215: A1C2H* + C2H2 <=> A2- */
    kc[214] = 1.0 / (refC) * exp((g_RT[44] + g_RT[22]) - (g_RT[45]));

    /*reaction 216: A1C2H* + C2H4 <=> A2 + H */
